import React from 'react';
import { useDispatch } from 'react-redux';
import './index.scss';
import { toogleComplead } from '../redux/todo/todoSlice';

export default function TodoTask({todo}) {
    const dispatch = useDispatch();

    const todoHandler = (id) => {
        dispatch(toogleComplead(id))
    }
    return (
        <div>
            <button onClick={() => todoHandler(todo.id)} className={todo.complead ? 'complead' : ''}>complead</button>
            <p>{todo.text}</p>
            <button>remove</button>
        </div>
    )
}
